import React from "react";
import { SearachBox } from "./atoms/SearchBox/Searchbox";
import "./styles.css";


class App extends React.Component {
  render() {
    return (
      <div className="App">
        <h1>Test</h1>
        <div class="content-wrapper">Content
        </div>
      </div>
    );
  }
}
export default App;
